roduct;        Ks = pow( max(dot(N, H), 0.0), shininess );        vec4 carSpecular = Ks * carSpecularProduct;        if( dot(L, N) < 0.0 ) {            specular = vec4(0.0, 0.0, 0.0, 1.0);        }        fColor = fColor * ( ambient + diffuse + specular + carAmbient + carDiffuse + carSpecular)  ;        fColor.a = 1.0;    }}</script><script id="fragment-shader" type="x-shader/x-fragment">precision mediump float;varying vec4 fColor;varying  vec2 fTexCoord;uniform sampler2D texture;uniform float textureFlag;voidmain(){    if(textureFlag == 1.0){        gl_FragColor = fColor  * texture2D( texture, fTexCoord );    }    else{        gl_FragColor = fColor;    }}</script><script type="text/javascript" src="./Common/webgl-utils.js"></script><script type="text/javascript" src="./Common/initShaders.js"></script><script type="text/javascript" src="./Common/MV.js"></script><script type="text/javascript" src="lib/webgl-obj-loader.js"></script><script type="text/javascript" src="dataStructures.js"></script><script type="text/javascript" src="collision.js"></script><script type="text/javascript" src="objects/cube.js"></script><script type="text/javascript" src="objects/sphere.js"></script><script type="text/javascript" src="objects/ramp.js"></script><script type="text/javascript" src="objects/cone.js"></script><script type="text/javascript" src="objects/ground.js"></script><script type="text/javascript" src="objects/car.js"></script><script type="text/javascript" src="renderOrder.js"></script><script type="text/javascript" src="render.js"></script><script type="text/javascript" src="aabb.js"></script><script type="text/javascript" src="game.js"></script><body><div style="width: 100%">    <div style="margin-left:auto; margin-right:auto; width: 50%">        <div id="centerpoint">            <div id="dialog">                <canvas id="gl-canvas" width="900" height="900" style="border:2px solid black">
